#include <stdio.h>
#include <stdlib.h>
#include <time.h>
#include <math.h>

void wait_for_vsync();
void plot_pixel(int x, int y, short int color);
void clear_screen();
char keyboard_input();
void swap(int *x, int *y);
void draw_line(int x0, int y0, int x1, int y1, short int line_color);
void draw_character(int x, int y, const int character[1600]);
void initialise_screen();
void move_character(int direction);
void draw_image(const int *image, int width, int height, int start_x, int start_y, int ref);
short int get_pixel_color(int x, int y); 

#define VIEWPORT_WIDTH 320
#define VIEWPORT_HEIGHT 240

int viewport_x = 0; // X position of the viewport in the maze array
int x = 0, y = 0; // Initial character position
const int *current_character = character_down;
volatile int *pixel_ctrl_ptr = (int *)0xFF203020; // pointer to the base register of controller

int main(void) {
    srand(time(NULL));

    // Set front pixel buffer to Buffer 1
    *(pixel_ctrl_ptr + 1) = (int)&Buffer1;
    wait_for_vsync();
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen(); // Clear screen on the front buffer

    // Set back pixel buffer to Buffer 2
    *(pixel_ctrl_ptr + 1) = (int)&Buffer2;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);
    clear_screen(); // Clear screen on the back buffer

    initialise_screen();

    while (1) {
        clear_screen(); // Clear screen before drawing
        draw_image(maze, VIEWPORT_WIDTH, VIEWPORT_HEIGHT, 0, 0, viewport_x);

        char input_1 = keyboard_input();
        if (input_1 == 0x75) { // up
            move_character(1);
        } else if (input_1 == 0x72) { // down
            move_character(0);
        } else if (input_1 == 0x6B) { // left
            move_character(2);
        } else if (input_1 == 0x74) { // right
            move_character(3);
        }

        draw_image(maze, VIEWPORT_WIDTH, VIEWPORT_HEIGHT, 0, 0, viewport_x);
        draw_character(x - viewport_x, y, current_character);

        // Check if character is at the door position
        if (get_pixel_color(x, y) == 0x1B4C09) {
            draw_image(enter, 40, 50, x - viewport_x, y, 0); // Display "Enter" button
        }

        wait_for_vsync(); // Swap front and back buffers on VGA vertical sync
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); // Update to new back buffer
    }
}

void plot_pixel(int x, int y, short int color) {
    volatile short int *one_pixel_address;
    one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);
    *one_pixel_address = color;
}

void clear_screen() {
    int y, x;
    for (x = 0; x < 320; x++)
        for (y = 0; y < 240; y++)
            plot_pixel(x, y, 0);
}

char keyboard_input() {
    int ps2_data;
    volatile int *ps2_ptr = (int *)0xFF200100; // Address for PS/2 data register

    do {
        ps2_data = *ps2_ptr;
    } while (!(ps2_data & 0x8000)); // Wait till bit 15 is set

    return ps2_data & 0xFF; // Mask last two bits for keyboard data
}

void swap(int *x, int *y) {
    int temp = *x;
    *x = *y;
    *y = temp;
}

void draw_line(int x0, int y0, int x1, int y1, short int line_color) {
    int is_steep = 0;
    int dx = x1 - x0;
    int dy = y1 - y0;

    if (abs(dy) > abs(dx)) {
        is_steep = 1;
    }

    if (is_steep) {
        swap(&x0, &y0);
        swap(&x1, &y1);
    }
    if (x0 > x1) {
        swap(&x0, &x1);
        swap(&y0, &y1);
    }
    int error = -(dx / 2);
    int y = y0;
    int y_step = (y0 < y1) ? 1 : -1;

    for (int x = x0; x <= x1; x++) {
        if (is_steep) {
            plot_pixel(y, x, line_color);
        } else {
            plot_pixel(x, y, line_color);
        }
        error += abs(dy);

        if (error >= 0) {
            y += y_step;
            error -= abs(dx);
        }
    }
}

void initialise_screen() {
    draw_line(0, 110, 200, 110, 0xFFFF);
    draw_line(0, 150, 230, 150, 0xFFFF);

    for (int i = 0; i <= 20; i++) {
        plot_pixel(200, 110 - i, 0xFFFF);
    }

    for (int i = 0; i <= 30; i++) {
        plot_pixel(230, 150 - i, 0xFFFF);
    }

    draw_line(200, 90, 319, 90, 0xFFFF);
    draw_line(230, 120, 319, 120, 0xFFFF);
}

void draw_character(int x, int y, const int character[1600]) {
    for (int i = 0; i < 40; i++) {
        for (int j = 0; j < 40; j++) {
            if (character[i * 40 + j] != 0x0000) {
                plot_pixel(x + j, y + i, character[i * 40 + j]);
            }
        }
    }
}

void move_character(int direction) {
    // Erase old character
    draw_character(x - viewport_x, y, (const int[1600]){0});

    if (direction == 0) {
        y += 4; // moving down
        current_character = character_down;
    } else if (direction == 1) {
        y -= 4; // moving up
        current_character = character_up;
    } else if (direction == 2) {
        x -= 8; // moving left
        current_character = character_left;
        viewport_x -= 8;
        // Ensure viewport doesn't go beyond the maze bounds
        if (viewport_x < 0) {
            viewport_x = 0;
        }
    } else if (direction == 3) {
        x += 8; // moving right
        current_character = character_right;
        viewport_x += 8;
        // Ensure viewport doesn't go beyond the maze bounds
        if (viewport_x + VIEWPORT_WIDTH > 640) {
            viewport_x = 640 - VIEWPORT_WIDTH;
        }
    }

    // Draw the new viewport and character position
    draw_image(maze, VIEWPORT_WIDTH, VIEWPORT_HEIGHT, 0, 0, viewport_x);
    draw_character(x - viewport_x, y, current_character);

    // Check if character is at the door position
    if (get_pixel_color(x, y) == 0x5120) {
        draw_image(enter, 40, 50, x - viewport_x, y, 0); // Display "Enter" button
    }
}

void wait_for_vsync() {
    volatile int *pixel_ctrl_ptr = (int *)0xFF203020;
    int status;

    *pixel_ctrl_ptr = 1;
    status = *(pixel_ctrl_ptr + 3);
    while ((status & 0x01) != 0) {
        status = *(pixel_ctrl_ptr + 3);
    }
}

void draw_image(const int *image, int width, int height, int start_x, int start_y, int ref) {
    for (int y = 0; y < height; y++) {
        for (int x = 0; x < width; x++) {
            int index = (y + start_y) * 640 + (x + start_x + ref);
            plot_pixel(x, y, image[index]);
        }
    }
}

short int get_pixel_color(int x, int y) {
    volatile short int *one_pixel_address;
    one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);
    return *one_pixel_address;
}


	
	